  const { id } = useParams();

  const [specialist, setSpecialist] = React.useState([]);

  React.useEffect(() => {
    axios.get('http://45.135.164.103:8080/api/specialists/'+id).then( ( {data} ) => {
      setSpecialist(data.specialist);
    } )
  }, []);

	return (
    <div className="Specialist">



    </div>
	);
}

export default Specialist;
